import React from 'react';
import './model.scss'

const Model = () => {
    return (
        <div className='model'>
            <div className="model__text">
                <h1 className="model__title">
                    Подбор модели <br/> электросамоката
                </h1>
                <p className="model__subtitle">
                    Пройдите тест и выберите <br/>электросамокат по своим критериям
                </p>
                <p className="model__link">
                    Подобрать модель
                </p>
            </div>
            <img className='model__img' src="/images/remove.png" alt=""/>
            <img className='model__elipse' src="/images/elipse.png" alt=""/>
        </div>
    );
};

export default Model;
